import { Container } from "react-bootstrap";

const About = () => {
  return (
    <section id="about-us">
      <Container style={{ bakgroundColor: "#7F7EC7" }}>
        <h1>About Us</h1>
      </Container>
    </section>
  );
};

export default About;
